import React from 'react';

function Food({name}){
  return (<h1>I am a {name}</h1>);
}

const foodName = [
  {id: 1, name: "kimchi"},
  {id: 2, name: "ramyeon"},
  {id: 3, name: "coffee"}
]

function renderFood(dish){
  return <Food key = {dish.id} name = {dish.name} />
}

function App() {
  return (
    <div>
      {console.log(foodName.map(renderFood))}
      {foodName.map(renderFood)}
    </div>
  );
}

export default App;
